import React from 'react'
import { useState } from 'react'
import Calendar from '..../pages/Calendar.jsx'

const Nav = () => {

  const [activeNav, setActiveNav] = useState('#')
  return (

    <nav>

      <a href="#home" onClick={() => setActiveNav('#')} className={activeNav === '#' ? 'active' : ''}>Home</a>
      <a href="#about" onClick={() => setActiveNav('#about')} className={activeNav === '#about' ? 'active' : ''}>Schedule </a>
      <a href="#experience" onClick={() => setActiveNav('#experience')} className={activeNav === '#experience' ? 'active' : ''}>Employees</a>
      <a href="#projects" onClick={() => setActiveNav('#myprojects')} className={activeNav === '#myprojects' ? 'active' : ''}>Contact</a>
      <a href="#contact" onClick={() => setActiveNav('#contact')} className={activeNav === '#contact' ? 'active' : ''}>Login</a>

    </nav>
  )
}

export default Nav
